CREATE TABLE branch_laba_sebelum_pajak_penghasilan_tax (
    id SERIAL PRIMARY KEY,
    label_rekonsiliasi_fiskal VARCHAR(100) NOT NULL,
    periode TIMESTAMPTZ NOT NULL,
    nilai NUMERIC(30,5) NOT NULL DEFAULT 0,
    created_at TIMESTAMPTZ NOT NULL DEFAULT NOW(),
    updated_at TIMESTAMPTZ NOT NULL DEFAULT NOW()
);

CREATE INDEX idx_label ON branch_laba_sebelum_pajak_penghasilan_tax(label_rekonsiliasi_fiskal);
CREATE INDEX idx_periode ON branch_laba_sebelum_pajak_penghasilan_tax(periode);
CREATE INDEX idx_nilai ON branch_laba_sebelum_pajak_penghasilan_tax(nilai);

